import React from 'react'
import Form from './Form'
import ShortenLinks from './ShortenLinks'
const Section1 = () => {
	var storage=localStorage.getItem('links')===null?null:JSON.parse(localStorage.getItem('links'))
	console.log(storage)
	return (
		<section className="Section1">
			<Form/>
			<ShortenLinks/>
			{storage.map((a,b)=>{
				if(a.url===undefined||b.shortUrl===undefined){
					return
				}
				return <ShortenLinks url={a.url} shortenUrl={a.shortUrl}/>
			})}
		</section>
	)
}

export default Section1
